import styled from 'styled-components'

const StyledButton = styled.button`
    background-color: #6750a4;
    border:none;
    color:#fff;
    padding:16px;

    &:hover,
    &:active{
        background-color : #463770
    }
`;

function Button({children}){
    return(
        <StyledButton><img/>{children}</StyledButton>
    )
}

export default Button
